import { v4 as uuid } from 'uuid';

const initialState = {
    items: [
        { id: uuid(), name: 'FB' },
        { id: uuid(), name: 'AAPL' },
        { id: uuid(), name: 'MSFT' },
        { id: uuid(), name: 'TSLA' },
    ]
}
